import "./main.scss"
import Header from "./components/Header";
import Opening from "./components/Opening";
import Carousel from "./components/Carousel";
import React from "react";

function App() {
  return (
    <div className="App">
        <Header/>
        <Opening/>
        <Carousel>
            <section className="slide slide_1">
                <h2 className="slide_header">Chorwacja 08-09.2022</h2>
                <p className="slide_text">Dwutygodniowy wyjazd do Chorwacji, gdzie dodatkowo zwiedzilismy takie kraje jak Albania i Czarnogora</p>
            </section>
            <section className="slide slide_2">
                <h2 className="slide_header">Wegry 05.2022</h2>
                <p className="slide_text">Wyjazd do Wegier, gdzie spotkalem Adriana z Motopodhaleinfo</p>
            </section>
            <img src="https://via.placeholder.com/1600x300" alt="placeholder" />
        </Carousel>
    </div>
  );
}

export default App;
